text_features:
Savinõukillud, 2 mõlemad killud hästipõletatud käsitsivormitud nõudest, ornamendita;
a) koostises keskmise jämedusega liiv, pinnad veidi mõranenud, värvilt pruunikas ja hall;
b) eelmisest veidi peenema koostisega, pinnad hea töötlusega, värvilt pruun ja hall; e.-v. kolmnurkse kujuga  Saadud Mati Mandeli juhatatud kaevamistel 1979.a.

Eseme ktk-d a) eseme ktk e.-v. kolmnurkse kujuga, naastu ktk(?);
b) kolmnurkse kujuga, ühel küljel silmakestest ja kolmest täkkjoonte reast koosnev ornament, ornament kulunud, käevõru v. sõrmuse ktk;
c) lahtine, kokkusurutud otstega, 0,2cm paksusest ümarast traadist  Saadud Mati Mandeli juhatatud kaevamistel 1979.a.

Käsikirjaline noodivihik. Laulud segakoorile: 
"Mälestus"; 
"Sind surmani"; 
"Liiri, lõõri, lõokene (Lõõri, lõõri, lõokene)" I variant; 
"Mina hoian memme ute"; 
"Kullake kurdab kaugel"; 
"Hoosianna (Hosianna), tõstke häält"; 
"Hällilaul (Emakene laulis, hällitas)"; 
"Mind, Jumal, Isa, õnnista" visand   Mart Saare isikukogu M9 Sind surmani (L. Koidula)
Liiri, lõõri, lõokene
Mina hoian memme ute (Rahvaluule)
Hoosianna, tõstke häält
